    require.config({
        config: {
            i18n: {
                locale: ($.cookie('i18n.langtag') || 'en-us').toLowerCase()
            }
        }
    });

    // Use almond's special top-level, synchronous require to trigger factory
    // functions, get the final module value, and export it as the public
